import './Button.css'

const UIButton = ({ children, className,  component: Component, ...restProps }) => {
    return (
    <Component className={`ui-button ${className}`} {...res}>{ children }</Component>
    );
};

UIButton.defaultProps = {
    component: 'a',
    className: '',
}

export default UIButton;
